export class LedgerDetail {
    amount: string
    currency: number
    isCredit: boolean
    description: string
    createdAt: string

    constructor(amount: string, currency: number, isCredit: boolean, description: string, createdAt: string) {
        this.amount = amount;
        this.currency = currency;
        this.isCredit = isCredit;
        this.description = description;
        this.createdAt = createdAt;
    }
}
